import React from 'react'
import { Button } from 'reactstrap'

function Dashboard() {
    return (
        <div>
            <div className="text-center">
                Sharoline User Assigment
            </div>
            <div>
                <Button className="btn btn__button-primary" onClick={() => {
                    window.location.href ='/users'
                }}> 
                    User Table
                </Button>
            </div>
        </div>
    )
}

export default Dashboard
